import React,{ Component } from 'react';
import Page1 from './admin/adpage1';
import './App.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { Navigate } from "react-router-dom";
class App extends React.Component
{

  constructor(props)
  {
    super(props);
    this.handleSubmit = this.handleSubmit.bind(this)
  }
  handleSubmit(event){
    navigate('./admin/adpage1')
  }
  render(){
    return(
      <div className="App">
      <header className="App-header">

        <button className='Adbutton'>Admin</button>
        <a
        onClick={this.handleSubmit}
        href="https://bobbyhadz.com/"
        target="_blank"
        rel="noreferrer"
      >
        bobbyhadz.com
      </a>

        <button className='Empbutton'>Employee</button>
      </header>
    </div>
    )

  }
}


export default App;
